/**
 * @description:  重定向路由（解决动态添加路由第一次不生效）
 * @param {*}
 * @return {*}
 */

const routeReplace = (routes, to, path = null) => {
  if (path) {
    return {
      path
    };
  }

  const findRoute = routes.find(route => route.path === to.path);
  const {
    query: {
      ak,
      ...rest
    },
    params
  } = to; // 如果动态路由中存在此路径 && vue-router 没有匹配到或者匹配到404则进行刷新

  if (findRoute && (!to.matched.length || to.matched.some(({
    name
  }) => name === '404'))) {
    return {
      path: to.fullPath,
      replace: true,
      query: { ...rest
      },
      params: params
    };
  } else if (!to.name) {
    // to.name 不存在应指向404
    return {
      path: '/404',
      replace: true
    };
  } else if (ak) {
    return {
      path: to.path,
      params,
      query: { ...rest
      }
    };
  }

  return true;
};

